(694, 4, 'CHU027', 'CHU', 'Lago Puelo', -42.062030792236, -71.598747253418, 'Avda. 2 de Abril s/n ', '9211', 'http://www.lagopuelo.gov.ar', 'No', 'MUNICIPIO DE SEGUNDA', 1928, 4, 2, 'En 1928, Remigio Nogués, un maestro que había sido enviado por el gobernador del Territorio Nacional del Chubut, señaló la necesidad de crear una comisión de fomento. El 2 de abril de ese año se creó la comisión, integrada en su gran mayoría por maestros. En 1937 el lago y los alrededores fueron incluidos en el Parque Nacional Los Alerces con el nombre de Anexo Puelo. Desde la sanción de la Ley Nº 19.292, en 1971, existe el Parque Nacional Lago Puelo. En esta localidad se establecieron familias europeas, especialmente polacos y rusos. (wikipedia)', 'Intendente', 'IVAN NORBERTO FERNANDEZ'),
